import React from "react";
import SearchBar from "../SearchBar";
import style from "../Nav/Nav.module.css";
import {Link }from "react-router-dom";

const Nav = ({ onSearch }) => {
  return (
    <div className={style.container}>
      <ul>

          <SearchBar onSearch={onSearch} />


          <Link to={"/home"}>
            <span>HOME</span>
          </Link>


          <Link to={"/about"}>
            <span>ABOUT</span>
          </Link>

      </ul>
    </div>
  );
};

export default Nav;
